import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPlus } from '@fortawesome/free-solid-svg-icons';


export default function Compone(){
    return(
     <>
      <div className='components'>
         <div className = "Apron"><b>Apron</b></div>
         <div className = "Drafter"><b>Drafter</b></div>
         <div className = "Calci"><b>Calci</b></div>
         <div className = "qp"><b>Question Paper</b></div>
         <div className = "Books"><b>Books</b></div>
         <div className = "other"><b>Other</b></div>
      </div>
      <div className = "add-icon">
        <FontAwesomeIcon icon ={faPlus} size='lg'></FontAwesomeIcon>
      </div>
     </>
    )
}
